				negate = distance != value;
				/* begin machineCodeAt:put: */
				aWord = (negate
					? subrnimmror(self_in_loadCwInto, destReg, PC, value, 0)
					: addrnimmror(self_in_loadCwInto, destReg, PC, value, 0));
