	assert(addressIsInCurrentCompilation((((self_in_loadCwInto->dependent))->address)));
	assert((SQABS((((((self_in_loadCwInto->dependent))->address)) - (((self_in_loadCwInto->address)) + 8)))) < (0x1000));
